@import url("https://fonts.googleapis.com/css2?family=Lato&display=swap");
@import url("https://fonts.googleapis.com/css2?family=Orbitron&display=swap");
@font-face {
  font-family: "curly", cursive;
  src: url(../fonts/Italianno-Regular.ttf) format("ttf");
  font-style: normal;
  font-weight: 400; }

* {
  margin: 0;
  box-sizing: border-box; }
  *:after, *:before {
    box-sizing: border-box; }

html,
body {
  overflow-x: hidden; }

body {
  font-family: "Lato", "sans-serif";
  line-height: 1.5; }

button,
input,
textarea,
select {
  font: inherit; }

p,
h1,
h2,
h3,
h4,
h5,
h6 {
  overflow-wrap: break-word; }

img,
video,
canvas,
svg {
  max-width: 100%; }

a {
  text-decoration: none;
  color: inherit; }

ul {
  list-style: none; }

.sneekpeeks {
  position: relative;
  height: 550px;
  background: #000;
  overflow: hidden;
  text-align: center;
  padding-top: 1rem; }
  .sneekpeeks__header {
    color: #fff;
    font-size: 40px;
    font-family: "curly"; }
  .sneekpeeks__images {
    padding-top: 2rem;
    width: 300px;
    height: 300px;
    position: absolute;
    white-space: nowrap;
    right: 80%;
    top: 6rem;
    animation: moveright 7s cubic-bezier(0.42, 0, 0.58, 1) infinite 0s; }

@keyframes moveright {
  0% {
    transform: translateX(-400%); }
  100% {
    transform: translateX(480%); } }
